import { useState } from "react";
import { useNavigate, useLocation } from "react-router-dom";

function EditContact({ onSave }) {
  const navigate = useNavigate();
  const contact = useLocation().state;

  const [firstName, setFirstName] = useState(contact.firstName);
  const [lastName, setLastName] = useState(contact.lastName);
  const [email, setEmail] = useState(contact.email);
  const [phoneNumber, setPhoneNumber] = useState(contact.phoneNumber);
  const [houseYard, setHouseYard] = useState(contact.houseYard);
  const [suite, setSuite] = useState(contact.suite);
  const [classYear, setClassYear] = useState(contact.classYear);
  const [homeCity, setHomeCity] = useState(contact.homeCity);
  const [homeState, setHomeState] = useState(contact.homeState);
  const [contactStatus, setContactStatus] = useState(contact.contactStatus);
  const [pteStatus, setPTEStatus] = useState(contact.pteStatus);
  const [registrationStatus, setRegistrationStatus] = useState(
    contact.registrationStatus
  );
  const [stageOfVotingProcess, setStageOfVotingProcess] = useState(
    contact.stageOfVotingProcess
  );
  const [whereRegistered, setWhereRegistered] = useState(
    contact.whereRegistered
  );

  const onSubmit = async (e) => {
    e.preventDefault();

    if (
      !firstName ||
      !lastName ||
      !email ||
      !phoneNumber ||
      !houseYard ||
      !suite ||
      !classYear ||
      !homeCity ||
      !homeState ||
      !contactStatus ||
      !pteStatus ||
      !registrationStatus ||
      !stageOfVotingProcess ||
      !whereRegistered
    ) {
      alert("Please fill in all fields.");
      return;
    }

    await onSave({
      firstName,
      lastName,
      email,
      phoneNumber,
      houseYard,
      suite,
      classYear,
      homeCity,
      homeState,
      contactStatus,
      pteStatus,
      registrationStatus,
      stageOfVotingProcess,
      whereRegistered,
    });

    navig;
  };

  return (
    <form onSubmit={onSubmit}>
      <div className="form-control">
        <label>First Name</label>
        <input
          type="text"
          placeholder="First Name"
          value={firstName}
          onChange={(e) => setFirstName(e.target.value)}
        ></input>
      </div>
      <div className="form-control">
        <label>Last Name</label>
        <input
          type="text"
          placeholder="Last Name"
          value={lastName}
          onChange={(e) => setLastName(e.target.value)}
        ></input>
      </div>
      <div className="form-control">
        <label>Email</label>
        <input
          type="email"
          placeholder="Email"
          value={email}
          onChange={(e) => setEmail(e.target.value)}
        ></input>
      </div>
      <div className="form-control">
        <label>Phone Number</label>
        <input
          type="tel"
          placeholder="Phone Number"
          value={phoneNumber}
          onChange={(e) => setPhoneNumber(e.target.value)}
        ></input>
      </div>
      <div className="form-control">
        <label>House/Yard</label>
        <input
          type="text"
          placeholder="House/Yard"
          value={houseYard}
          onChange={(e) => setHouseYard(e.target.value)}
        ></input>
      </div>
      <div className="form-control">
        <label>Suite</label>
        <input
          type="text"
          placeholder="Suite"
          value={suite}
          onChange={(e) => setSuite(e.target.value)}
        ></input>
      </div>
      <div className="form-control">
        <label>Class Year</label>
        <input
          type="text"
          placeholder="Class Year"
          value={classYear}
          onChange={(e) => setClassYear(e.target.value)}
        ></input>
      </div>
      <div className="form-control">
        <label>Home City</label>
        <input
          type="text"
          placeholder="Home City"
          value={homeCity}
          onChange={(e) => setHomeCity(e.target.value)}
        ></input>
      </div>
      <div className="form-control">
        <label>Home State</label>
        <input
          type="text"
          placeholder="Home State"
          value={homeState}
          onChange={(e) => setHomeState(e.target.value)}
        ></input>
      </div>

      <div className="form-control">
        <label>Contact Status</label>
        <select
          value={contactStatus}
          onChange={(e) => setContactStatus(e.target.value)}
        >
          <option value="Contacted">Contacted</option>
          <option value="Contacted But No Response">
            Contacted But No Response
          </option>
          <option value="Not Contacted">Not Contacted</option>
        </select>
      </div>
      <div className="form-control">
        <label>PTE Status</label>
        <select
          value={pteStatus}
          onChange={(e) => setPTEStatus(e.target.value)}
        >
          <option value="Full PTE Completed">Full PTE Completed</option>
          <option value="Only Short PTE Completed">
            Only Short PTE Completed
          </option>
          <option value="Not Completed">Not Completed</option>
        </select>
      </div>
      <div className="form-control">
        <label>Registration Status</label>
        <select
          value={registrationStatus}
          onChange={(e) => setRegistrationStatus(e.target.value)}
        >
          <option value="Registered">Registered</option>
          <option value="Registration In Progress">
            Registration In Progress
          </option>
          <option value="Not Registered">Not Registered</option>
        </select>
      </div>
      <div className="form-control">
        <label>Stage of Voting Process</label>
        <select
          value={stageOfVotingProcess}
          onChange={(e) => setStageOfVotingProcess(e.target.value)}
        >
          <option value="Voted In Person">Voted In Person</option>
          <option value="Submitted Mail-in/Absentee Ballot">
            Submitted Mail-in/Absentee Ballot
          </option>
          <option value="Plan To Vote In Person">Plan To Vote In Person</option>
          <option value="Requested Mail-in/Absentee Ballot">
            Requested Mail-in/Absentee Ballot
          </option>
          <option value="Unknown">Unknown</option>
        </select>
      </div>

      <div className="form-control">
        <label>Where Registered</label>
        <input
          type="text"
          placeholder="Where Registered"
          value={whereRegistered}
          onChange={(e) => setWhereRegistered(e.target.value)}
        ></input>
      </div>

      <input type="submit" value="Save" />
    </form>
  );
}

export default EditContact;
